descriptions:
{'es-ES': '¡Exclusivo! ¡Vivienda a estrenar! Si su sueño es vivir en el centro de Donostia, no deje pasar esta oportunidad absolutamente única. Edificio de nueva construcción a 3 minutos de la playa de la Concha. Acabados de lujo, 2 ascensores a cota cero, portal representativo.\xa0

Características de la vivienda: Calefacción por suelo radiante, persianas eléctricas, domótica, electrodomésticos de alta gama.\xa0\xa0

Información personal\xa0'}

{'es-ES': 'EDIFICACION NUEVA DE RECIENTE CONSTRUCCION, VENTA DE VIVIENDA A ESTRENAR CON LA COCINA EQUIPADA. 
LA VENTA INCLUYE EN EL PRECIO PLAZA GARAJE Y TRASTERO

LA VIVIENDA ES LUMINOSA Y SOLEADA, DE FINA CONSTRUCCION. EL PORTAL NO OFRECE BARRERAS ARQUITECTONICAS.'}

{'es-ES': 'En pleno centro de San Sebastián, Donostia, en Área Romántica, presentamos esta maravillosa vivienda con dos habitaciones y 70 m2 (60 m2 útiles) a reformar totalmente. Muchísimas posibilidades. A patio de manzana con orientación sureste. Posibilidad de distribuir, tras reforma, dos amplias habitaciones, dos baños y un espacio amplio y diáfano con cocina, comedor salón. Sin barreras arquitectónicas y ascensor cota cero. Gastos de comunidad: 60 €/mes. ITE del edificio al día.

En una ubicación incomparable. A 400 mts (5 minutos andando) de la playa de La Concha, Ayuntamiento, Alderdi Eder, Parte Vieja, boulevard...\xa0 A 800 mts (10 minutos andando) de la playa de La Zurriola y el barrio de Gros. Todos los servicios necesarios a un paso: comercio, supermercados, ambulatorio, bibliotecas, restaurantes, bares, terrazas, Avenida, playas...etc.

Contacta con nosotros para más información o concertar una visita sin ningún tipo de compromiso.'}

{'es-ES': 'Es una vivienda que está perfecta para entrar a vivir.

Dispone de 2 habitaciones, salón, cocina y 2 baños, también dispone de un trastero incluido en el precio.

El edificio tiene ascensor a cota cero, zona muy cómoda para vivir'}

{'es-ES': 'Magnífico piso en el barrio de Yurre, recién reformado. La vivienda cuenta con 90m², dispone de 3 dormitorios, salón- cocina abierto, un baño y dos balcones.La vivienda a sido reformada al completo y la fachada y el tejado lo han restaurado recientemente. 

Zona tranquila y cómoda para vivir, dispone de un Carrefour a 500m y el municipio de Beasain a tan solo dos minutos en coche.

Si lo que buscas en una vivienda en una zona tranquila...¡Esta puede ser la tuya!'}

{'es-ES': 'Se trata de una tercera planta con ascensor de 82 m2 útiles distribuido en dos habitaciones, salón con salida a balcón, un cuarto de baño completo con ducha, una amplia cocina office y un hermoso balcón.

Piso totalmente exterior y con mucha luz natural. Se encuentra a pocos minutos caminando del ayuntamiento.

Inmueble en buen estado y con acceso a la finca habilitada para personas con movilidad reducida.'}

{'es-ES': 'Vivienda en planta baja en la calle de la Salud, muy céntrica, situada a escasos metros de la Plaza Easo. Calle muy tranquila, sin apenas tránsito de coches.

Consta de un gran salón-comedor con frente de cocina, con sitio para poner comedor, zona de estar..., con ventanales a la calle. Dos habitaciones grandes a parte trasera con salida a amplia terraza (no hay vistas), dos baños.

La vivienda se encuentra en muy buen estado. Posibilidad de sacar muy facilmente la tercera habitación.'}

{'es-ES': 'PARA ENTRAR A VIVIR. Vivienda en el centro, junto a supermercado, colegios y zonas deportivas. 58 m2 útiles que cuentan con salón comedor con amplio ventanal, cocina equipada y con salida a BALCON, 2 dormitorios, el principal con armario empotrado y baño equipado.

Vivienda del 2006 que cuenta con calefacción de GAS NATURAL, ventanas de climalit y carpintería de ROBLE. Ascensor a cota 0

Ideal como inversión o primera vivienda.'}

{'es-ES': 'Precioso, reformado\xa0y ámplio piso ubicado en una de las zonas más tranquilas de la ciudad. Nos encontramos con este enorme piso de 120m2 útiles, distribuidos en 3 dormitorios todos ellos exteriores y el principal disponiendo de una amplia terraza orientada y con vistas a Jaizkibel, baño exterior y completo\xa0con plato de ducha y bañera, aseo interior, enorme salón comedor con mueble de minibar y cocina exterior totalmente equipada con cuarto de lavadora.\xa0

Terraza comunitaria, amplia y soleada donde poder realizar comidas,tomar algo o relajarte al sol.

Fachada, tejado y portal recien hechos.'}

{'es-ES': 'Se trata de una vivienda de 85m2 en el casco antiguo de Orio, distribuido en dos plantas.

En la planta baja encontramos la cocina con un amplio comedor y el cuarto de baño. Mientras tanto, en la primera planta tenemos 3 habitaciones, una pequeña salita y un despacho, todas las estancias exteriores.

además en la planta alta del edificio dispone de una amplia Buhardilla de unos 35m2.'}

{'es-ES': 'En GROS, en la calle SEGUNDO ISPIZUA MUY CERCA DE LA PLAYA DE LA ZURRIOLA, se vende piso distribuido en 3 habitaciones con armarios empotrados (2 de ellas exteriores a patio abierto), 2 baños con ducha (uno de ellos reformado), sala exterior con salida a balcón a patio abierto y cocina equipada. Con calefacción central de gas, aunque dispone de contador individual. ORIENTACIÓN OESTE. LUMINOSO y SOLEADO. 
MUY BIEN SITUADO y COMUNICADO. Muy cerca dispone de todos los servicios (supermercado, farmacia, parada de autobús, etc.. . ).

AGENCIA INMOBILIARIA y ASESORÍA JURÍDICA NUEVO GROS es una agencia inmobiliaria con más de 35 años de experiencia, que cuenta con Agentes de la Propiedad Inmobiliaria y Abogados EXPERTOS EN DERECHO INMOBILIARIO, para el asesoramiento de nuestros clientes en la COMPRA-VENTA y ALQUILER de fincas. Para cualquier consulta no dude en llamarnos 943-293029.'}

{'es-ES': '"Se alquila este magnífico caserío totalmente reformado en el alto de Azkarate. Situado entre Azkoitia y Elgoibar

Alquiler
Imprescindible aval bancario."'}

{'es-ES': 'OPORTUNIDAD NUEVO PRECIO!

PISO CON TERRAZA EN EL ANTIGUO
Piso de 71m2 (incluida terraza) exterior y soleado en el barrio de El Antiguo de San Sebastián. Distribuido en 3 habitaciones, salón-comedor, cocina, baño y tendedero. Techos altos. TERRAZA de 4m2 soleada. INSTALACION DE ASCENSOR EN CURSO. Próximo a la playa de Ondarreta. Calefacción con gas natural. Vivienda luminosa. Muchas posibilidades. Ideal para pareja joven.'}

{'es-ES': 'Vivienda ubicada en Bidebarrieta\xa0de grandes dimensiones.

Para reformar con muchas posibilidades.

Edificio con ascensor.'}

{'es-ES': 'Caserío en Otadi aldea, situado entre Lazkao y Ataun. Con una ubicación privilegiada, cerca del río y a su vez  a menos de 100 m de la  carretera GI 2120, y un bidegorri  de acceso  Lazkao.
El caserío está para reformar , permitiendose el acondicionamiento de dos viviendas .Dispone de una superficie de 570m2  con terreno alrededor y con unos pertenecidos de 15 hectáreas. 
 
'}

{'es-ES': 'En venta - Piso de lujo y alta seguridad en edificio con portero de día y de noche. Vistas al mar desde todas las habitaciones excepto el baño. Hay un dormitorio pero puede hacer 2 dormitorios y 2 baños. La ubicación es la mejor de San Sebastián, al lado del Parte Vieja, pero sin el ruido. Duérmete con el sonido del océano. Hay un mirador y un balcón desde la sala de estar, la cocina y el dormitorio. Se vende el meubles. Compra directa del propietario.

===============

Luxury and high security apartment in a building with day and night doorman. Sea views from all rooms except the bathroom. It is a 1 bedroom apartment but you can make 2 bedrooms and 2 bathrooms. Location is the best in San Sebastian, next to the old town, but without the noise. Fall asleep to the sound of the ocean. There is a mirador and balcony from the living room, kitchen and bedroom. The furniture is for sale. Buy direct from owner.'}

{'es-ES': 'Se vende vivienda Alquilada (con inquilino) con contrato de 5 años.

Apartamento en portal sin barreras arquitectónicas en el centro. En perfectas condiciones.
\xa0'}

{'es-ES': 'Venta de piso en Irún (parte vieja) donde llevando solamente la ropa puedes comenzar a vivir en ella, porque está totalmente amueblada (menos Tv). 55m2(aprox.)
Consta de 1 baño con plato de ducha y mampara, wc, lavabo y armario vertical, además de una fuente eléctrica de agua decorativa. 

La cocina está equipada con horno, frigorífico con puertas de cristal, lavadora-secadora, fuego inducción y campana extractora y un sistema de tratamiento de agua última generación. Termo eléctrico última generación y calefacción eléctrica última generación también. En la cocina hay dos mesas (una plegable con banco y  otra mesita auxiliar). En la habitación armarios empotrados en toda la pared y cama exenta en el centro de la habitación. El salón tiene dos armarios empotrados a cada lado con luces bajo uno de ellos, con un efecto muy agradable de noche. Un fuego &quot;chimenea&quot; eléctrico que calienta y da sensación especial. El sofá es un sofá cama modelo italiano (tirando de una cinta se abre al instante) de color amarillo, y una cama auxiliar  de 80cm que se utiliza como mesilla central. También mesa de comedor extensible (12 personas). Tiene dos balcones que dan a la calle Contracalle.  Gastos comunitarios de 30€mes, portal y escalera recién restaurados (cepillado, pintado y papel pintado) y tejado hecho. Reforma del piso realizada en 2017 y casa super cuidada, con lo que casi se podría decir que está a estrenar (con muy poco uso).'}

{'es-ES': 'Vivienda de protección oficial, en régimen general y carácter permanente.

La vivienda dispone de 2 habitaciones, sala, cocina equipada y baño. La vivienda es completamente exterior.

Dispone de trastero y raya de garaje.'}

{'es-ES': '\xa0Vivienda de 3 dormitorios, salón, cocina, 2 baños y tendero. Despejado.

Calefacción de gas natural.

Se incluye en el precio 2 plazas de garaje con\xa0acceso directo y trastero en bajocubierta.'}

{'es-ES': 'Vivienda de 65 m2 situada en una 3 planta sin ascensor (con posibilidad de ponerlo). Se distribuye  en un salón comedor con la cocina abierta, 3 habitaciones, un cuarto de baño completo con ducha y un balcón.

Vivienda TOTALMENTE REFORMADA. electricidad, fontanería, instalación de gas, caldera, calefacción radiante, ventanas con mosquiteras, puertas y techos bajados. Aislante en el techo con 80mm de lana-roca y en las paredes con celulosa. Cocina DICA.

Además incluye un trastero de 10m2 con doble altura.'}

{'es-ES': 'Ubicada en una segunda planta con ascensor, se trata de una vivienda de 98 m2 construidos distribuido en 3 habitaciones (dos de ellas dobles),salón, cocina, un pequeño comedor, un amplio hall, una pequeña despensa y un baño completo.

Calefacción en todas las estancias. Vivienda con muchísimas posibilidades de redistribución. Vistas totalmente despejadas.
'}

{'es-ES': 'EXCLUSIVA! Se vende hermosa vivienda, alta y luminosa con amplia terraza en la calle Misericordia. 

La vivienda está distribuida en 3 dormitorios, salón, cocina, baño y aseo. Desde el salón y el dormitorio principal se accede a amplia terraza. La vivienda necesita reforma, con muchas posibilidades. 

Ascensor sin barreras en edificio de hormigón.'}

{'es-ES': 'VIVIENDA DE OBRA NUEVA

Precio desde 170.000 euros.

Vivienda de 2 habitaciones, con garaje y trastero, ubicada en Errekatxu de Eibar. Dispondrá de un local social (txoko) y gimnasio para uso y disfrute de los vecinos, además de locales comerciales y un supermercado. Viviendas luminosas con amplias terrazas y vistas despejadas. Las viviendas estarán dotadas de cocinas completamente equipadas y frentes de armarios. ¡¡ÚLTIMAS VIVIENDAS!! Contacta con nosotros'}

{'es-ES': 'Bonito y cuidado caserío con terreno de unos 100.000 m2 (10 ha) situado en Ormaiztegi (Gipuzkoa). El terreno está rodeado de árboles frutales y pinar, totalmente cuidado y a pleno rendimiento. Ubicado en plena naturaleza para quien guste o necesite de un caserío con terreno. Adecuado para destinarlo a actividades agrícolas/ganaderas y compaginarlo con una buena vivienda , para vivir rodeado de\xa0plena naturaleza y bien comunicado por carretera con otras localidades del Goierri/San Sebastián...

Características Interiores: La vivienda consta de 2 plantas de unos 100 m2 cada una: -Planta baja con amplia sala, cocina-comedor muy hermosa, baño completo con ducha, y hermoso garaje ( habilitado como despensa y trastero). -Planta 1ª con 4 habitaciones/estancias amplias y con muy buena altura. El estado de conservación es muy bueno, la fachada de estilo tradicional vasco, el tejado a dos aguas, chimenea en uso, suelos de terrazo, instalación eléctrica en uso, cocina y baño equipados...

Características Exteriores: La fachada es raseada con recercos de piedra, el tejado es a 2 aguas\xa0y el caserío está bien conservado. Es adecuado para quién desee dedicarse a la explotación agrícola y/o ganadera, ya que el terreno circundante lo permite. El acceso al caserío está asfaltado hasta la propia vivienda y se encuentra cerca\xa0del Cementerio de la localidad. Ormaiztegi situado en el corazón de la comarca del Goierri, está muy bien comunicada, a unos 6,5 km de Segura, a 8,5 de Zumarraga o 48 km de Donostia.'}

{'es-ES': 'Se vende piso en Urazandi con \xa0hermoso balcon muy soleado de orientación sur.

El piso, consta de hall, tres dormitorios, salon, cocina, baño y aseo. Tambien dispone de \xa0otro\xa0balcon cerrado que se accede desde dos de los dormitorios.\xa0

Zona tranquila.'}

{'es-ES': 'La vivienda dispone de tres habitaciones, salón, cocina con salida al balcón y baño.

Todas las habitaciones son exteriores incluso el baño.

La vivienda es muy soleada, luminosa y con unas vistas fantásticas.'}

{'es-ES': 'La vivienda requiere una reforma integral pero con muchas posibilidades.

En la actualidad dispone de 2 habitaciones, sala, cocina y baño.

El edificio es de hormigón, con vistas al rio.'}

{'es-ES': 'Precioso piso\xa0de nueva construcción con una preciosas terraza\xa0 en planta primera y ubicada\xa0en un entorno muy agradable.

La vivienda se distibuye en hall, salón-comedor -cocina americana con salida a terraza de , 2 habitaciones (\xa0 también con salida a esa terraza)\xa0)cocina y baño.\xa0 Trastero 8.270€ Opción de garaje cerrado \xa0por 19.000€.

Facilidad de pago, información en la oficina.'}

{'es-ES': 'VENTA CASERIO DE TRES PLANTAS, POSIBILIDAD DE RECONVERTIRLA EN BIFAMILIAR. CON ANTEPUERTA Y PORCHE. Y PARCELA - HUERTA PEGANTE. 

UBICACION DENTRO DEL NUCLEO URBANO

ACCESO DESDE TOLOSA, 4 KM '}

{'es-ES': 'Piso en la Calle Usandizaga; en el corazón del barrio de moda; a 50 metros de la Playa de La Zurriola. La vivienda consta de salón con salida a balcón con vistas a\xa0la calle,una amplia cocina, 3 habitaciones,un\xa0baño completo\xa0con plato de ducha y un aseo.

Necesita\xa0 actualización. Disponemos de\xa0proyecto de obra y plano.\xa0

\xa0.'}

{'es-ES': 'PISO EN VENTA EN XENPELAR 7, ERRENTERIA

Piso en el centro de Errenteria, situada en la Xenpelar nº 7 con balcones orientados a la zona peatonal de la Calle Viteri. Actualmente 75 m2 útiles y 80 m2 construidos aproximadamente,  con 2 balcones y ventanales. Anteriormente fue una academia pero figura como vivienda, su distribución es de 3 dormitorios, baño y un pequeño office,  tiene salida a un patio interior.  El piso está conectado por una escalera a un local comercial en la parte inferior con entrada por calle Viteri. Existe la posibilidad de compra de dicho local por una cantidad adicional (52.500€) no incluida en el precio del piso. Dadas las características actuales y la ubicación, es ideal para profesionales o inversores.  Necesita reforma integral.
'}

{'es-ES': 'Vivienda a la venta Se sitúa cercana al centro del municipio de Eibar en la provincia de Guipúzcoa donde cuenta con una buena comunicación, rodeado de viviendas similares y zonas verdes, alcance de todos los servicios, como equipamiento escolar, deportivos, comercios de diferente índole, centro de salud, lúdico, establecimiento de comercial, entre otros.

Se encuentra bien comunicado con varias líneas de autobús y taxi en sus inmediaciones, su conexión con resto del municipio es buena y se encuentra próximo a las carreteras principales.
Se distribuye en una cocina amplia, un baño amplio, salón-comedor con un gran ventanal que le aporta mucha luz, balcón y tres habitaciones con amplios ventanales que le aportan mucha luz a todas las estancias y una terraza con buenas dimensiones contigua al salón-comedor.'}

{'es-ES': 'Gran vivienda a cuatro\xa0fachadas con grandes balcones soleados. Amplio salón con chimenea,\xa0\xa0cocina-comedor y cinco dormitorios de diferentes tamaños. Tres cuartos de baño.

Garaje\xa0para dos coches. \xa0

Una vivienda a reformar, con grandes posibilidades.\xa0'}

{'es-ES': 'Buhardilla para entrar a vivir.\xa0

Consta de hall, salón, cocina, 2 dormitorios y baño.\xa0
'}

{'es-ES': 'Pº de Zubiaurre, se vende piso exterior de 81m2 según catastro en edificio de hormigón, consta de salón, 4 dormitorios, cocina y 1 cuarto de baño. El piso es totalmente exterior con orientación Norte-Sur-Oeste, dispone de una pequeña terraza en la parte trasera con acceso desde el exterior del edificio.

La vivienda tiene\xa0 parking comunitario.

ITE pasada sin derramas pendientes.'}

{'es-ES': 'En el término de Zarautz, caserío con 9,5 ha. de terreno con proyecto para 2 viviendas, casa rural.....   
Buen acceso, requiere reforma. Otros edificios adicionales y pabellón de 800 m2 de construcción mas reciente, apropiado para guardería de perros, de caballos.. 

 590.000 €'}

{'es-ES': '¡Nuevas distribuciones!
Ibaiondo Berri es una estupenda oportunidad de mejorar tu calidad de vida, disfrutando de un entorno armonioso y agradable. La promoción se encuentra ubicada en una situación privilegiada, en una tranquila zona residencial con magníficas vistas al río y al monte. Tendrás todo a mano, con fácil acceso a todos los servicios. Se encuentra junto al centro de salud, a 4 minutos andando de la plaza el Ayuntamiento, el polideportivo y el teatro. 

 

Promozio berria salgai! Ibaiondo Berri zure bizi-kalitatea hobetzeko aukera paregabea da, ingurune atsegin eta harmoniatsu batean. Promozioak kokapen pribilegiatua du, ibaira eta mendira bista bikainak dituen bizitegi-gune lasai batean baitago. Guztia eskura izango duzu, zerbitzu guztiekiko gertutasuna izanik, osasun zentroaren ondoan dago, eta udaletxeko plazatik, polikiroldegitik eta komertzioetatik 4 minutura oinez.'}

{'es-ES': 'Piso totalmente exterior en la zona de la playa de Orio de 86m2 distribuido en 2 habitaciones dobles ( una de ellas en suit con salido a balcón), 2 baños ( uno con bañera) cocina office con salida también a balcón, una galería, y un salón comedor con vistas despejadas al puerto deportivo y a la ria.

Se trata de una segunda planta en finca joven con ascensor directo al garaje. el inmueble se vende con una plaza de parking. suelos de parquet, carpinteria de aluminio con doble vidrio y calefacción en todas las estancias.

En una zona inmejorable de Orio, a 5 minutos caminando de la playa y acceso rápido a la autopista permitiendo llegar a Donostia en 15 minutos.'}

{'es-ES': 'Vivienda completamente exterior.

2 habitaciones, sala, cocina y baño.

Requiere actualización.'}

{'es-ES': 'Bidebieta, calle Juan Carlos Guerra se vende vivienda de 80 m2 útiles en torre con aparcamiento rotatorio. Toda exterior. Salón-comedor con gran mirardor. 3 Habitaciones exteriores. Cocina-comedor con salida a balcón con tenderte. 2 Baños interiores, 1 con bañera y 1 con plato de ducha. Amplio hall con armario empotrado. Suelos de madera\xa0de elondo. Calefacción de gas natural. Orientación suroeste. Con ascensor sin barreras.\xa0

Vivienda en buen estado aunque hbría que actualizar cocina.\xa0

Aparcamiento cubierto para motos y bicis.'}

{'es-ES': 'En zona TRANQUILA del Barrio de Arbes.
Te ofrecemos esta vivienda de 58,47 m2, 3habiatciones, salón, cocina con salida a balcón cerrado, 1 baño. Sol toda la mañana, parking cercano. Ventanas cambiada de PVC. ¡TOTALMENTE EXTERIOR!

SI quieres más información ó visitarlo, no dudes en ponerte en contacto con nosotras en el 943 63 18 04, o pasarte por nuestra oficina en PºColón 17, trasera (entrada por Joaquín Gamón. TE ESPERAMOS!'}

{'es-ES': 'Bertsolari Txirrita, piso de 79m2 útiles según catastro distribuido en salón-comedor exterior con amplio ventanal, 3\xa0dormitorios (uno de ellos exterior con salida a balcón\xa0y dos a patio), cocina y\xa0baño con plato de ducha. Ascensor sin barreras arquitectónicas. Suministros de gas ciudad.

Edificio de hormigón de 1975. Actualmente están rehabilitando el patio interior y queda pagado.\xa0Muy bien ubicado junto a transporte público.\xa0

INMOBILIARIA ARRIGAIN, oficina en San Sebastián, avda. Libertad, 1 bajo. Telf.: 943 450 66'}

{'es-ES': 'En inmejorable zona, calle PEÑA Y GOÑI, a un paso de la playa de la Zurriola y del Kursaal se vende estupendo piso de 100m2 distribuidos de la siguiente manera: 

Amplio salón-comedor exterior con salida a balcón con orientación Oeste, 3 dormitorios dobles, cocina reformada, baño y aseo. La calefacción es individual de gas natural. La vivienda necesita actualizar exceptuando la cocina. 

Edificio de hormigón con ascensor.'}

{'es-ES': 'La vivienda se encuentra eb buen estado y dispone de calefacción de gas natural.

Está distribuida en 3 habitaciones, sala, amplia cocina y baño.

Se incluye un trastero.'}

{'es-ES': 'Estudio exterior con balcón corrido a C/San Lorenzo.  Luminoso y soleado. Habitación con vestidor separada a la sala  y la cocina por un cristal ovalado . Cama matrimonio con canapé, armarios empotrado. Baño completo con ducha con mampara. Cocina completa, (dispone de secadora).  Las puertas de balcón corrido dispone  de puertas de doble acristalamiento,. Situado en la Parte Vieja de Donostia, en una calle tranquila. Y próximo a la Bretxa y  a las paradas de autobús.
Ideal para parejas o persona sola.

Teléfono de contacto 617319713 (whatsapp)'}

{'es-ES': 'EN GOIATZ, EN EL CENTRO, EDIFICIO DE TRES VIVIENDAS, VENTA DE PISO PRIMERO CON BALCON, HUERTA PROPIA DE 167 M2, LOCAL GARAJE PROPIO DE 31 M2 Y LOCAL TRASTERO DE 21 M2. 

EDIFICIO CUIDADO Y MANTENIDO. LA VIVIENDA ESTA PARA REFORMAR. 

ES SOLEADA Y LUMINOSA. '}

{'es-ES': 'VIVIENDA DE OBRA NUEVA

Precio desde 127.500 euros.

Vivienda de 1 habitación, con garaje y trastero, ubicada en Errekatxu de Eibar. Dispondrá de un local social (txoko) y gimnasio para uso y disfrute de los vecinos, además de locales comerciales y un supermercado. Viviendas luminosas con amplias terrazas y vistas despejadas. Las viviendas estarán dotadas de cocinas completamente equipadas y frentes de armarios. ¡¡ÚLTIMAS VIVIENDAS!! Contacta con nosotros'}

{'es-ES': 'Vivienda para entrar a vivir, en última planta y\xa0con amplia terraza.

Consta de cocina-salón-comedor, 2 habitaciones, baño y terraza.

Edificio con ascensor a cota 0.'}

